    data: |
      SELECT + col2 * - + col2 FROM tab1 (FORMAT parquet) WHERE col0 + + + col0 + - col1 NOT IN ( col1 + + + col1, - col1 * + 62 + + ( - + 6 ) );
  - name: tab1

outputs:
  - name: q1916.out
    data: |
      -3481
      -4624
      -9216
